// Channels

import React from 'react';
import PropTypes from 'prop-types';
import './channels.scss';

const Channels = props => {
    console.log(props.sellers)
    return (
        <section className="channels">
            <div className="container">
            <div className="row">
            <p className='col-md-12 channels-title' >Đối tác hoàn tiền </p>
                {props.sellers && props.sellers.map((item,key) => {
                   console.log(item);
                      <div className="col-md-2 mt-5 channels-image">
                      <img src={item.logo_image_src} alt={item.name} name={item.name}/>
                  </div>
               })}
                </div>
            </div>
        </section>
    );
};

export default Channels;
